import { experience } from "../Data/data";

const Experience = () => {
  return (
    <div id="experience">
      {experience.map((item) => (
        <a
          href={item.companyWebsite}
          target="_blank"
          rel="noreferrer"
          key={item.id}
          className="mb-8 hover:bg-blue-300 block rounded-lg transition-colors duration-300 hover:bg-opacity-5"
        >
          <div className="px-8 py-12" style={{ color: "#888D91" }}>
            <p className="font-medium mb-1" style={{ color: "#98FBFC" }}>
              {item.role} - <span style={{ color: "#158CE1" }}>{item.company}</span>
            </p>
            <p className="text-sm mb-2" style={{ color: "#235588" }}>
              {item.duration}
            </p>
            <p className="mb-2">{item.description}</p>
            <p className="text-xs flex space-x-4">
              {item.techStack.map((tech) => (
                <span
                  key={tech}
                  className="px-2 py-1 rounded-lg"
                  style={{ backgroundColor: "#3D5684", color: "#98FBFC" }}
                >
                  {tech}
                </span>
              ))}
            </p>
          </div>
        </a>
      ))}
    </div>
  );
};

export default Experience;
